import gql from 'graphql-tag';

export const GET_COUNT = gql`
    query programsCount {
        programsCount
    }
`

export const GET_ALL_PROGRAMS = gql`
    query allPrograms($offset: Float, $limit: Float) {
    allPrograms(offset: $offset, limit: $limit){
        name
        degreeType
        deliveryMode
        school{
        name
        totalEnrollment
        }
    }
    }
`
